import React from 'react';
import '../css/header.css';

class Header extends React.Component {
  render() {
		return (
			<header>
               <a href="/">Личный кабинет</a>
               <a href="/">Отчетность</a>
               <a href="/">Помощь</a>
               <a href="/">Реестр показателей</a>
               <a href="/">О портале</a>
            </header>
		)
	}
}

export default Header;
